import React from 'react';
import { StyleSheet, Text, View, TextInput, TouchableOpacity, TouchableHighlight} from 'react-native';

export default class AboutUs extends React.Component {
    render() {
        const image = {
            height:50,
            width:40,
        //    alignSelf: 'center',
        }

        return (
        <View style={styles.container}>
            <View>
                <Text style={styles.head}>About Us</Text>
            </View>
            <View style={styles.RectangleShapeView}>
            <View style={styles.RectangleShapeIn}>
                <Text style={styles.logo}>P-indicator</Text>
                <Text style={styles.contents}> Description </Text>
            </View>   
            <View style={styles.RectangleShapeIn}>
                {/* <Image source={{uri:'../assets/prachi.png'}}
                style={{height:50, width:40}} /> */}
                {/* <Image style={styles.image} source={require('../assets/logo.png')} /> */}
                <Text style={styles.contents}> Name: Prachi Palkar</Text>
                <Text style={styles.contents}> E-mail Id: prachipalkar18@gmail.com </Text>
                <Text style={styles.contents}> Description </Text>
            </View>
            <View style={styles.RectangleShapeIn}>
                <Text style={styles.contents}> Name: Prachi Palkar</Text>
                <Text style={styles.contents}> E-mail Id: prachipalkar18@gmail.com </Text>
                <Text style={styles.contents}> Description </Text>
            </View>
            <View style={styles.RectangleShapeIn}>
                <Text style={styles.contents}> Name: Prachi Palkar</Text>
                <Text style={styles.contents}> E-mail Id: prachipalkar18@gmail.com </Text>
                <Text style={styles.contents}> Description </Text>
            </View>
            <View style={styles.RectangleShapeIn}>
                <Text style={styles.contents}> Name: Prachi Palkar</Text>
                <Text style={styles.contents}> E-mail Id: prachipalkar18@gmail.com </Text>
                <Text style={styles.contents}> Description </Text>
            </View>
            <View style={styles.RectangleShapeIn}>
                <Text style={styles.contents}> For Support: Contact Us</Text>
                <Text style={styles.contents}> E-mail Id: prachipalkar18@gmail.com </Text>
            </View>
            </View>
        </View>
        );
    }
}

const styles = StyleSheet.create({
    container: {
        flex: 1,
        backgroundColor: "#008484",
        alignItems: 'center',
        justifyContent: 'center',
    },
    head: {
        fontSize: 30,
        fontFamily: "calibri",
        color: "#ffffff",
        marginBottom: 20
    },
    logo: {
    //    fontWeight: "bold",
        fontSize: 50,
        fontFamily: "calibri",
        color: "#008484",
        alignSelf: 'center',
    //    marginBottom: 40
    },
